import React from 'react';
import './App.css';
import NavBar from '../navbar/navbar'
import CounterList from "../counterList/counterList";

function App() {
  return (
      <React.Fragment>
        <NavBar></NavBar>
        <main className="container">
          <CounterList/>
        </main>
      </React.Fragment>
  );
}

export default App;
